import React from "react";
import {Button, Card, Col, Container, Navbar, Row, Footer} from 'react-bootstrap';
import Plans from './helpers/plans-helper';

export default class Home extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            }
        this.bind();
        };
    bind() {
        this.redirectFromWhats = this.redirectFromWhats.bind(this);
    }

    redirectFromWhats(){
        return window.open("https://api.whatsapp.com/send/?phone=5511948816521&text&type=phone_number&app_absent=0")
    }

    render() {
        return (
        <>
            <Container>
                <Navbar>
                    <div>
                        <span>Dr. Leonardo Simões
                            Nutrição Clínica e Esportiva
                        </span>
                        <span>Planos</span>
                        <span>Contatos</span>
                        <span>
                            <Button className="button-agendar" onClick={() => this.redirectFromWhats()}>
                                <i className="bi bi-whatsapp"></i>
                                Agendar consulta
                            </Button>
                        </span>
                    </div>
                </Navbar>
                <Row>
                    <img></img>
                    <span>

                    </span>
                </Row>
                <Row>
                    <h1>Como funcionam os planos</h1>
                    {Plans.map(plan =>
                            <Card>
                                <Card.Body>
                                    <span>{plan.title}</span>
                                    <br/>
                                    <span>{plan.description}</span>
                                </Card.Body>
                            </Card>
                        )}
                </Row>
                <Row>
                    {Plans.map(plan =>
                        <Card>
                            <Card.Body>
                                <span>{plan.title}</span>
                                <span>{plan.description}</span>
                            </Card.Body>
                        </Card>
                    )}
                </Row>
            </Container>
        </>
        )
    }
}
